'use strict';

var VariablePage = require('../models/pages/VariablePage.js');

const variableEditPage = async ({ page, selectors, grafanaVersion, request }, use, testInfo) => {
  const variablePage = new VariablePage.VariablePage({ page, selectors, grafanaVersion, request, testInfo });
  await variablePage.goto();
  const variableEditPage2 = await variablePage.clickAddNew();
  await use(variableEditPage2);
};

exports.variableEditPage = variableEditPage;
